import React from "react";

const Projects = () => {
  return (
    <section id="projects">
      <h2>Projects</h2>
      <div>
        <h3>HYDROSPHERE</h3>
        <p>08/2021 - 05/2022</p>
        <p>
          HYDROSPHERE - Revolutionizing Freshwater Sustainability by Harvesting
          Atmospheric Water in Egypt
        </p>
      </div>
      <div>
        <h3>CS50 Project</h3>
        <p>Details about the CS50 project.</p>
      </div>
    </section>
  );
};

export default Projects;
